  PRIMARY KEY (`id`),
  KEY `attainment_users_user_id_foreign` (`user_id`),
  KEY `attainment_users_state_id_foreign` (`state_id`),
  KEY `attainment_users_attainment_id_foreign` (`attainment_id`),
  CONSTRAINT `attainment_users_attainment_id_foreign` FOREIGN KEY (`attainment_id`) REFERENCES `attainments` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `attainment_users_state_id_foreign` FOREIGN KEY (`state_id`) REFERENCES `states` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `attainment_users_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=857 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
